import React from "react"
import Product from "./Product"
import products from "./products"

function MyApp(){

    const item=products.map(p => 
        <Product key={p.id} name={p.name} price={p.price}
        description={p.description}/>)

    return (
        <div>
            {item}
        </div>
    )
}

export default MyApp
